Hey <@U07NSHMCAG5>,
looks like the font-family is wrong.
there's a &lt;style&gt;-tag coming in from somewhere which states
```hs_cos_wrapper_post_body a:not(.cta_button):not(:empty):after {
    padding-left: 4px;
    font-family: "Font Awesome 5 Free";
    font-weight: 900;
    content: "\f35d";
    margin-right: 8px;
}```
but should be
```hs_cos_wrapper_post_body a:not(.cta_button):not(:empty):after {
    padding-left: 4px;
    font-family: "FontAwesomePro";
    font-weight: 900;
    content: "\f35d";
    margin-right: 8px;
}```
If you have a dedicated post body module it could be placed there.
